  'För att skapa en ny enkät klickar du på knappen enkäter i navigeringsbaren, där ser du en överblick på dina enkäter som du har skapat, om du vill skapa en ny, klickar du bara på plus-ikonen i högerkanten.' => 'To create a new survey, click on the polls in the navigation bar, where you can see an overview of your surveys that you have created, if you want to create a new one, just click on the plus icon on the right wing.',
  'För att söka efter CV:n kan du gå tillväga på två sätt. Antingen söker du direkt i sökrutan på startsidan eller så klickar du på Sökning upp som finns i menyn till höger om kontakt-knappen. Här fyller du i önskad information för sökning av CV:n och klickar sedan på Sök-knappen. Notera att om du inte fyller i några uppgifter kommer alla CV:n att visas! Du har möjlighet att välja om CV:n ska sorteras på rubrik, datum eller anställningsform. Detta gör du genom att klicka på önskat sorteringsalternativ som anges strax under Sök-knappen.' => 'To search for CVs, you can proceed in two ways. Either you look directly into the search box on the home page or click on Search up in the menu to the right of the contact button. Here you fill in the required information for searching CVs and click the Search button. Note that if you do not fill in a few details will all CVs appear! You have the option to choose whether CVs should be sorted on title, date or employment status. You do this by clicking on the sorting options listed just below the Search button.',
  'För att kunna skapa och lägga upp CV:n måste du först vara registrerad som publicerare. För att sedan lägga upp ett CV klickar du på Skapa nytt cv. Här väljer du vilken typ av anställning du är intresserad av. Du får välja mellan antigen ett konsultuppdrag eller en vanlig anställning, och i vilken del av världen som du vill arbeta på. Därefter väljer du det CV som du vill ladda upp. Notera att CV:t måste vara en pdf-fil för att kunna laddas upp! Om du vill kan du välja att lägga till ett eller flera nyckelord till ditt CV för att öka sökträffen hos rekryterare. Detta gör du genom att fylla i nyckelord på den avsedda platsen strax ovanför Publicera-knappen.' => 'To be able to create and upload CVs you must first be a registered publishers. To then post a resume, click Create new cv. Here you select the type of employment you are interested. You get to choose between either a consultant or a regular employment, and in which part of world you want to work on. You then select the resume you wish to upload. Note that the CV must be a pdf file to be uploaded! If you prefer, you can choose to add one or more keywords to your resume to increase sökträffen of recruiters. You do this by completing the keyword in the space just above the Publish button.',
  'För att kunna ha pågående rekryteringsprocesser måste du vara inloggad som en rekryterare, klicka på “Rekryteringsprocesser” i menyn högst upp. Då kommer dina pågående rekryteringsprocesser att synas överst och de avslutade rekryteringsprocesserna kommer att synas nedanför. Åt höger ovanför de pågående rekryteringsprocesserna finns en knapp som heter “Lägg till ny process” där du kan skapa en ny process.' => 'In order to have ongoing recruitment processes need to be logged in as a recruiter, click on "Recruitment Processes" in the top menu. Then your current recruitment processes appear at the top and they finished the recruitment processes will be seen below. Right above the ongoing recruitment processes, there is a button called "Add New Process" where you can create a new process.',
  'För att få tillgång till systemet måste man registrera ett användarkonto. Vid registrering av användarkonto finns det en ruta att kryssa för om du är en rekryterare. Om du inte kryssar för rutan så registreras du automatiskt som en publicerare. Registrera dig-knappen är blå och är synlig längst upp till höger. För att slutföra en registrering måste man aktivera sitt konto genom ett bekräftelsemail som man får skickat till den e-postadress som angetts.' => 'To access the system must register a user account. When registering a user account there is a box to tick if you are a recruiter. If you do not check the box, so you are automatically registered as a publisher. Register button is blue and is visible at the top right. To complete the registration you must activate their account through a confirmation email that you get sent to the email address specified.',
  'För att kommunicera med andra användare på cv-pages kan du skicka meddelanden eller livechatta. Om du är inloggad som en rekryterare kan du välja att påbörja chattsamtal med intressanta publicerare. Lägg till det intressanta cv:t i den aktuella rekryteringsprocessens hotlist och därifrån kan du starta en chatt eller skicka ett meddelande. Svaren som du får hamnar i din inbox för meddelanden. Den hittar du högst upp i högra hörnet genom att klicka på din användarprofil.' => 'To communicate with other users on cv-pages you can send messages or chat live. If you are logged in as a recruiter, you can choose to initiate chat conversations with interesting publishers. Make it interesting CVs ti the current recruitment process hotlist and from there you can start a chat or send a message. The answers that you may end up in your inbox for messages. It is found in the top right corner, click on your user profile.',
  'För att kunna lägga till ett intressant cv i en hotlist måste du vara registrerad som rekryterare först och främst. När du är en rekryterare har du möjlighet att skapa en process för att samla intressanta kandidater till den tjänst som behöver fyllas. Du gör så här: När du är inloggad och söker efter cv i sökningsfunktionen, kan du välja att lägga till ett cv till en hotlist. Varje hotlist hör till en rekryteringsprocess. Genom att trycka på knappen lägg till i hotlist, får du välja att skapa en ny process eller lägga tillcv i en process som redan finns genom att klicka på namnet i dropdown-menyn som presenteras för dig.' => 'To add an interesting résumé in a hotlist, you must be registered as a recruiter first and foremost. When you are a recruiter, you can create a process to collect interesting candidates for the post to be filled. You do this: Once you are logged in and are looking for CVs in the search function, you can choose to add a cv to a hotlist. Each hotlist belongs to a recruitment process. By pressing the button add to hotlist, you may choose to create a new process or add tillcv in a process that is already available by clicking on the name in the dropdown menu that is presented to you.',
